import React, { Component } from 'react';
import axios from 'axios';
import {URL} from '../../../../config';     

import styles from '../../articles.css';

class NewsArticles extends Component {

    state = {
        article: [],
        team: []
    }
    
    componentWillMount () {
        axios.get()
    }

    render() {
        return (
            <div>
                Articles View
            </div>
        );
    }
}

export default NewsArticles;
